[{"location":"","page":"-","title":"-","text":"CurrentModule = Main.OurModuleName\r\nDocTestSetup = quote\r\n    println(\"hi!\")\r\n    using Main.OurModuleName\r\nend","category":"page"},{"location":"","page":"-","title":"-","text":"Modules = [Main.OurModuleName]","category":"page"},{"location":"#Main.OurModuleName.MP-Tuple{Vector{<:Union{Integer, Rational}}, Vector{<:Union{Integer, Rational}}}","page":"-","title":"Main.OurModuleName.MP","text":"MP(y, z)\n\nCompute the middle product of polynomials y and z.\n\nFor vectors y = y_1y_n and z = z_1z_2n-1 of polynomial coefficients, return c_n-1 c_2n-1, where c_k = sum_i + j = k a_i b_j.\n\nExamples\n\njulia> Main.OurModuleName.MP([4, 6, 38, -1], [1, 2, 3, 4, 8, 9, 26, 7])\n4-element Vector{Int64}:\n 109\n 168\n 233\n 458\n\njulia> Main.OurModuleName.MP([-7//10, 1, -2], [9//4, -1//4, -2//5, 9//8, -4//9, -1//2])\n3-element Vector{Rational{Int64}}:\n -447//100\n  -11//16\n  161//72\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.compute_Δ-Union{Tuple{S}, Tuple{T}, Tuple{T, S}} where {T<:Integer, S<:Integer}","page":"-","title":"Main.OurModuleName.compute_Δ","text":"compute_Δ(a, d)\n\nCompute the Δ function from lemma 2 in BGS07.\n\nFor a degree d and shift a  d, return a vector Δ_0 Δ_d, where Δ_i = prod_j = 0^d (a + i - j).\n\nExample\n\njulia> Main.OurModuleName.compute_Δ(5, 3)\n4-element Vector{Integer}:\n  120\n  360\n  840\n 1680\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.compute_δ-Tuple{T} where T<:Integer","page":"-","title":"Main.OurModuleName.compute_δ","text":"compute_δ(d)\n\nCompute the δ function from lemma 2 in BGS07.\n\nFor a degree d, return a vector δ_0 δ_d, where δ_i = prod_j = 0 j neq i^d (i - j).\n\nExample\n\njulia> Main.OurModuleName.compute_δ(5)\n6-element Vector{Rational}:\n -1//120\n  1//24\n -1//12\n  1//12\n -1//24\n  1//120\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.lagrange-Union{Tuple{T}, Tuple{Vector{<:Union{Integer, Rational}}, T}} where T<:Integer","page":"-","title":"Main.OurModuleName.lagrange","text":"lagrange(p, a)\n\nLagrange interpolate a vector p of polynomial outputs to a new position a.\n\nFor a polynomial P, apply Lagrange interpolation to the values p = P(0) P(1)  P(d) to produce a vector of shifted values P(a) P(a + 1)  P(a + d).\n\nExample\n\njulia> Main.OurModuleName.lagrange([1//4, -7//4, -31//4], 3)\n3-element Vector{Rational{Int64}}:\n  -71//4\n -127//4\n -199//4\n\n\n\n\n\n","category":"method"}]
